import { Link } from 'react-router-dom';

const AdminDashboard = () => {
  return (
    <div className="container mt-5">
      <h2>Admin Dashboard</h2>
      <Link to="/admin/flights" className="btn btn-info m-2">Manage Flights</Link>
      <Link to="/admin/hotels" className="btn btn-info m-2">Manage Hotels</Link>
    </div>
  );
};

export default AdminDashboard;
